import React from 'react';

const Error =()=>{
    return (
        <section id="content">
            <h2 className="subheader">Error 404 - Pagina no encontrada</h2>
            <p>La pagina a la que intentas acceder no existe.</p>
        </section>
    );
}
export default Error;
